import React from 'react';
import {
  MDBInput,
  MDBBtn,
} from 'mdb-react-ui-kit';
import contactImage from '../../images/Version control-cuate.png'

function Contact() {
  return (


<div class="container">
  <div class="row gx-1 justify-content-around" style={{ marginBottom: '100px', marginTop:'100px' }}>

    <div class="col-md-6">
          <div class="row justify-content-center">
            <div class="col-8">
          <form>
            <MDBInput id='form4Example1' wrapperClass='mb-4' label='Name' />
            <MDBInput type='email' id='form4Example2' wrapperClass='mb-4' label='Email address' />
            <MDBInput wrapperClass='mb-4' textarea id='form4Example3' rows={4} label='Message' />
            <MDBBtn type='submit' className='mb-4' block>
            Submit
            </MDBBtn>
          </form>
          </div>
        </div>
    

    </div>
    <div class="col-md-6">
    <img
                src={contactImage}
                alt="home pic"
                className="img-fluid"
                
              />

    </div>

  </div>
</div>









    
  );
}

export default Contact;
